import React from "react"
import { Icon } from 'semantic-ui-react'

const NavBar = () => {
    return (
        <div className="navBar">
            <Icon name='github' link size='huge' />
            <Icon name="linkedin" link size='huge' />
            <Icon name="medium" link size="huge" />
        </div>
    )
}

export default NavBar
